import './style.css'


function changeBlur() {
    var Newblur = this.state.blur === 'blur(10px)' ? 'blur(0px)' : 'blur(10px)';
    this.setState({ blur: Newblur });
}
function Saldo() {


    return (
        <div className='Saldo'
             style={{filter:this.state.blur}}
             onClick={this.changeBlur}   
        >

        </div>
    );

}

export default Saldo;
